<ul>
<li>矮胖的神经网络和高瘦的神经网络，假设它们参数量相同，哪一个更好呢？
实验证明在参数量相当的情况下，高瘦的神经网络（即深度神经网络）的准确度更高，因为深度可以实现模块化。</li>
<li>只用一个神经元足够多的隐藏层，这个模型就包括了任意函数，那为什么不这么做呢？
这样确实可以包括任意函数，但实现的效率不高。</li>
</ul>
